    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Tamarac NWR and WMD for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Tamarac NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge and the WMD, an overview of the CCP process, information about the environment,
    information about the management direction, and strategies for implementation. Key
    planning issues include: wildlife management, habitat management, visitor services,
    facilities, and roads.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
